e practice, especially in algebraic operations, is needed. Remember, practice makes perfect.', 'Firdy Aymansyah'),('20231', 'c', '4', '6', '16', '', 'You have fairly good reasoning skills, complemented by a solid foundation of initial knowledge and a strong sense of curiosity. You readily absorb new learning and execute tasks proficiently. Due to entering later than your peers, you may find yourself somewhat behind in some topics. However, with your abilities, you can easily revisit past materials with the help of the internet, by seeking guidance from teachers, and by using notes from your classmates. You have a solid foundation, but more practice, especially in algebraic operations, is needed. Remember, practice makes perfect.'),('20231', 'c', '4', '6', '8', 'You exhibit a strong sense of ambition. Furthermore, your reasoning abilities, when honed, can evolve into a formidable asset. I greatly appreciate your dedicated focus on your studies and your willingness to approach problem-solving with enthusiasm. However, it seems that you may benefit from better sleep management to prevent drowsiness during class. I encourage you to preserve your enthusiasm and address areas where improvement is needed.', 'Keisya Delita Arafah'),('20231', 'c', '4', '6', '8', '', 'You exhibit a strong sense of ambition. Furthermore, your reasoning abilities, when honed, can evolve into a formidable asset. I greatly appreciate your dedicated focus on your studies and your willingness to approach problem-solving with enthusiasm. However, it seems that you may benefit from better sleep management to prevent drowsiness during class. I encourage you to preserve your enthusiasm and address areas where improvement is needed.'),('20231', 'c', '4', '6', '2', 'Your happy personality and right-brain dominance are something I've noticed, and I understand that it may lead to a lesser inclination towards mathematics. However, a bit of effort won't hurt. You do have reasonably quick reasoning skills. It's just that, because you're less interested, you might not be inclined to put in more effort. You tend to be passive in your learning, but when I directly ask you, you can provide very good answers. What you should work on is improving your focus and giving it another shot so that you can perform well in exam questions, at the very least.', 'Muhammad Kenzie Natta'),('20231', 'c', '4', '6', '2', '', 'Your happy personality and right-brain dominance are something I've noticed, and I understand that it may lead to a lesser inclination towards mathematics. However, a bit of effort won't hurt. You do have reasonably quick reasoning skills. It's just that, because you're less interested, you might not be inclined to put in more effort. You tend to be passive in your learning, but when I directly ask you, you can provide very good answers. What you should work on is improving your focus and giving it another shot so that you can perform well in exam questions, at the very least.'),('20231', 'c', '4', '6', '9', 'You are one of the students who is very receptive to guidance. You readily grasp new concepts, are willing to try, and remain composed. However, one area where you can improve is your hesitancy to ask questions. This makes it challenging to gauge your level of understanding on certain concepts. Therefore, moving forward, please maintain your enthusiasm for learning, but also hone your interpersonal skills and do not hesitate to seek clarification through questions.', 'Naila Saffa Atania Wibowo'),('20231', 'c', '4', '6', '9', '', 'You are one of the students who is very receptive to guidance. You readily grasp new concepts, are willing to try, and remain composed. However, one area where you can improve is your hesitancy to ask questions. This makes it challenging to gauge your level of understanding on certain concepts. Therefore, moving forward, please maintain your enthusiasm for learning, but also hone your interpersonal skills and do not hesitate to seek clarification through questions.'),('20231', 'c', '4', '6', '10', 'After studying for several months, I have noticed a reasonably significant progress in you. You have started to confidently respond in English and have also become more focused in your learning. I believe you are very capable in mathematics, but language remains a challenge. Please maintain your curiosity and willingness to ask questions to ensure there are no misunderstandings of concepts. One aspect that requires improvement is your tendency to become easily distracted and inclination towards leisure activities. You also tend to forget to complete asynchronous lessons and formative assignments. However, this is something that can be easily changed with the determination to continue learning.', 'Naufal Rizq Anugrah'),('20231', 'c', '4', '6', '10', '', 'After studying for several months, I have noticed a reasonably significant progress in you. You have started to confidently respond in English and have also become more focused in your learning. I believe you are very capable in mathematics, but language remains a challenge. Please maintain your curiosity and willingness to ask questions to ensure there are no misunderstandings of concepts. One aspect that requires improvement is your tendency to become easily distracted and inclination towards leisure activities. You also tend to forget to complete asynchronous lessons and formative assignments. However, this is something that can be easily changed with the determination to continue learning.'),('20231', 'c', '4', '6', '11', 'Your foundational knowledge is highly commendable. Coupled with your strong reasoning abilities and an excellent memory, engaging in mathematical discussions with you is both effortless and enjoyable. Nonetheless, there is always room for growth. I encourage you to further strengthen your logical sense to the extent that you can actively participate in mathematics competitions at both the national and international levels. Your diligent attitude toward learning is an additional asset that you should consistently maintain and nurture.', 'Nayla Angelica Mewandari'),('20231', 'c', '4', '6', '11', '', 'Your foundational knowledge is highly commendable. Coupled with your strong reasoning abilities and an excellent memory, engaging in mathematical discussions with you is both effortless and enjoyable. Nonetheless, there is always room for growth. I encourage you to further strengthen your logical sense to the extent that you can actively participate in mathematics competitions at both the national and international levels. Your diligent attitude toward learning is an additional asset that you should consistently maintain and nurture.'),('20231', 'c', '4', '6', '12', 'You have a high level of enthusiasm for learning. You are one of the students whose progress is clearly visible. Your ability to grasp lessons easily and your willingness to ask questions greatly facilitate your learning. You have a solid understanding of basic algebra and fractions. However, when it comes to decimals, algebraic factoring, and more advanced algebra, you often encounter difficulties. Practicing problems can help you overcome these challenges and enable you to master the mathematics curriculum. Please continue to maintain your enthusiasm in class.', 'Ni Luh Putu Ivana Azdiantha'),('20231', 'c', '4', '6', '12', '', 'You have a high level of enthusiasm for learning. You are one of the students whose progress is clearly visible. Your ability to grasp lessons easily and your willingness to ask questions greatly facilitate your learning. You have a solid understanding of basic algebra and fractions. However, when it comes to decimals, algebraic factoring, and more advanced algebra, you often encounter difficulties. Practicing problems can help you overcome these challenges and enable you to master the mathematics curriculum. Please continue to maintain your enthusiasm in class.'),('20231', 'c', '4', '6', '13', 'In your everyday learning, your enthusiasm shines through brightly. You're never shy to ask questions when something isn't clear, and your daily assignments are consistently well done. However, during some tests, you seem to face challenges. You have a solid foundation, but it seems like a bit more practice might be the missing ingredient. Revisiting your lessons and tackling more practice problems can help you get comfortable with various question formats. Also, it's a good idea to keep off-topic discussions in class to a minimum to make sure you don't miss any important information.', 'Putri Ayesha Ainun Mahya'),('20231', 'c', '4', '6', '13', '', 'In your everyday learning, your enthusiasm shines through brightly. You're never shy to ask questions when something isn't clear, and your daily assignments are consistently well done. However, during some tests, you seem to face challenges. You have a solid foundation, but it seems like a bit more practice might be the missing ingredient. Revisiting your lessons and tackling more practice problems can help you get comfortable with various question formats. Also, it's a good idea to keep off-topic discussions in class to a minimum to make sure you don't miss any important information.'),('20231', 'c', '4', '6', '14', 'You have demonstrated proficiency in comprehending Fractions, decimals, and percentages. Your inquisitive nature has facilitated ongoing development. However, in the realm of Algebra, additional practice is advisable. Furthermore, it is recommended that you refine your attitude, particularly in interactions with friends, teachers and other adults. This approach will contribute not only to the enhancement of your mathematical abilities but also to the cultivation of your soft skills.', 'Putri Nara Razeca'),('20231', 'c', '4', '6', '14', '', 'You have demonstrated proficiency in comprehending Fractions, decimals, and percentages. Your inquisitive nature has facilitated ongoing development. However, in the realm of Algebra, additional practice is advisable. Furthermore, it is recommended that you refine your attitude, particularly in interactions with friends, teachers and other adults. This approach will contribute not only to the enhancement of your mathematical abilities but also to the cultivation of your soft skills.'),('20231', 'c', '4', '6', '15', 'Let me start by praising your dedication to attending class and your ability to confidently answer questions about fractions, decimals, percents, and simple algebra. Your commitment to learning these concepts is truly commendable. However, I've also noticed occasional struggles with confidence and negative thoughts in math. These challenges are normal, and with determination, practice, and support, I'm confident you can overcome them.', 'Rifdah Dzakirah Mirzani'),('20231', 'c', '4', '6', '15', '', 'Let me start by praising your dedication to attending class and your ability to confidently answer questions about fractions, decimals, percents, and simple algebra. Your commitment to learning these concepts is truly commendable. However, I've also noticed occasional struggles with confidence and negative thoughts in math. These challenges are normal, and with determination, practice, and support, I'm confident you can overcome them.');
