ication through questions.'),('20231', 'c', '4', '6', '10', 'After studying for several months, I have noticed a reasonably significant progress in you. You have started to confidently respond in English and have also become more focused in your learning. I believe you are very capable in mathematics, but language remains a challenge. Please maintain your curiosity and willingness to ask questions to ensure there are no misunderstandings of concepts. One aspect that requires improvement is your tendency to become easily distracted and inclination towards leisure activities. You also tend to forget to complete asynchronous lessons and formative assignments. However, this is something that can be easily changed with the determination to continue learning.', 'Naufal Rizq Anugrah'),('20231', 'c', '4', '6', '10', '', 'After studying for several months, I have noticed a reasonably significant progress in you. You have started to confidently respond in English and have also become more focused in your learning. I believe you are very capable in mathematics, but language remains a challenge. Please maintain your curiosity and willingness to ask questions to ensure there are no misunderstandings of concepts. One aspect that requires improvement is your tendency to become easily distracted and inclination towards leisure activities. You also tend to forget to complete asynchronous lessons and formative assignments. However, this is something that can be easily changed with the determination to continue learning.'),('20231', 'c', '4', '6', '11', 'Your foundational knowledge is highly commendable. Coupled with your strong reasoning abilities and an excellent memory, engaging in mathematical discussions with you is both effortless and enjoyable. Nonetheless, there is always room for growth. I encourage you to further strengthen your logical sense to the extent that you can actively participate in mathematics competitions at both the national and international levels. Your diligent attitude toward learning is an additional asset that you should consistently maintain and nurture.', 'Nayla Angelica Mewandari'),('20231', 'c', '4', '6', '11', '', 'Your foundational knowledge is highly commendable. Coupled with your strong reasoning abilities and an excellent memory, engaging in mathematical discussions with you is both effortless and enjoyable. Nonetheless, there is always room for growth. I encourage you to further strengthen your logical sense to the extent that you can actively participate in mathematics competitions at both the national and international levels. Your diligent attitude toward learning is an additional asset that you should consistently maintain and nurture.'),('20231', 'c', '4', '6', '12', 'You have a high level of enthusiasm for learning. You are one of the students whose progress is clearly visible. Your ability to grasp lessons easily and your willingness to ask questions greatly facilitate your learning. You have a solid understanding of basic algebra and fractions. However, when it comes to decimals, algebraic factoring, and more advanced algebra, you often encounter difficulties. Practicing problems can help you overcome these challenges and enable you to master the mathematics curriculum. Please continue to maintain your enthusiasm in class.', 'Ni Luh Putu Ivana Azdiantha'),('20231', 'c', '4', '6', '12', '', 'You have a high level of enthusiasm for learning. You are one of the students whose progress is clearly visible. Your ability to grasp lessons easily and your willingness to ask questions greatly facilitate your learning. You have a solid understanding of basic algebra and fractions. However, when it comes to decimals, algebraic factoring, and more advanced algebra, you often encounter difficulties. Practicing problems can help you overcome these challenges and enable you to master the mathematics curriculum. Please continue to maintain your enthusiasm in class.'),('20231', 'c', '4', '6', '13', 'In your everyday learning, your enthusiasm shines through brightly. You're never shy to ask questions when something isn't clear, and your daily assignments are consistently well done. However, during some tests, you seem to face challenges. You have a solid foundation, but it seems like a bit more practice might be the missing ingredient. Revisiting your lessons and tackling more practice problems can help you get comfortable with various question formats. Also, it's a good idea to keep off-topic discussions in class to a minimum to make sure you don't miss any important information.', 'Putri Ayesha Ainun Mahya'),('20231', 'c', '4', '6', '13', '', 'In your everyday learning, your enthusiasm shines through brightly. You're never shy to ask questions when something isn't clear, and your daily assignments are consistently well done. However, during some tests, you seem to face challenges. You have a solid foundation, but it seems like a bit more practice might be the missing ingredient. Revisiting your lessons and tackling more practice problems can help you get comfortable with various question formats. Also, it's a good idea to keep off-topic discussions in class to a minimum to make sure you don't miss any important information.'),('20231', 'c', '4', '6', '14', 'You have demonstrated proficiency in comprehending Fractions, decimals, and percentages. Your inquisitive nature has facilitated ongoing development. However, in the realm of Algebra, additional practice is advisable. Furthermore, it is recommended that you refine your attitude, particularly in interactions with friends, teachers and other adults. This approach will contribute not only to the enhancement of your mathematical abilities but also to the cultivation of your soft skills.', 'Putri Nara Razeca'),('20231', 'c', '4', '6', '14', '', 'You have demonstrated proficiency in comprehending Fractions, decimals, and percentages. Your inquisitive nature has facilitated ongoing development. However, in the realm of Algebra, additional practice is advisable. Furthermore, it is recommended that you refine your attitude, particularly in interactions with friends, teachers and other adults. This approach will contribute not only to the enhancement of your mathematical abilities but also to the cultivation of your soft skills.'),('20231', 'c', '4', '6', '15', 'Let me start by praising your dedication to attending class and your ability to confidently answer questions about fractions, decimals, percents, and simple algebra. Your commitment to learning these concepts is truly commendable. However, I've also noticed occasional struggles with confidence and negative thoughts in math. These challenges are normal, and with determination, practice, and support, I'm confident you can overcome them.', 'Rifdah Dzakirah Mirzani'),('20231', 'c', '4', '6', '15', '', 'Let me start by praising your dedication to attending class and your ability to confidently answer questions about fractions, decimals, percents, and simple algebra. Your commitment to learning these concepts is truly commendable. However, I've also noticed occasional struggles with confidence and negative thoughts in math. These challenges are normal, and with determination, practice, and support, I'm confident you can overcome them.');
